import React from 'react';
import './Skill.css';
import htmlicon from '../ImagesLogo/html-5.png';
import reacticon from '../ImagesLogo/atom.png';
import jsicon from '../ImagesLogo/js.png';
// import pythonicon from '../ImagesLogo/python.png';
import cssicon from '../ImagesLogo/css-3.png';


function Skills() {
  return (
    <div>
          <div className="about-skills">
                <h1 style={{ fontSize: '35px',textAlign:'center' }}>Skills</h1>
                <div className="about-skill">
                    <p><img src={htmlicon} alt='' style={{ marginTop: '1px', position: 'absolute', marginLeft: '-35px' }} />HTML</p><hr style={{ width: '67%' }} />
                </div>
                <div className="about-skill">
                    <p><img src={cssicon} alt='' style={{ marginTop: '1px', position: 'absolute', marginLeft: '-35px' }} />CSS</p><hr style={{ width: '65%' }} />
                </div>
                <div className="about-skill">
                    <p><img src={jsicon} alt='' style={{ marginTop: '1px', position: 'absolute', marginLeft: '-35px' }} />JavaScript</p><hr style={{ width: '59%' }} />
                </div>
                <div className="about-skill">
                    <p><img src={reacticon} alt='' style={{ marginTop: '1px', position: 'absolute', marginLeft: '-35px' }} />React JS</p><hr style={{ width: '64%' }} />
                </div>
            </div>
            <div className="other-skills">
                div.other
            </div>
    </div>
  )
}

export default Skills
